import { Fragment } from "react";



const App = () => {

  const prices = {
    arak: {
      halberd: "400gp",
      "brassArmor": "150gp",
      steelShield: "80gp"
    }
  }

  return (
    <div 
      style={{
      display: "flex",
      width: "100vw",
      height: "100vh",
      justifyContent: "center",
      alignItems: "center"
    }}>
      <div style={{ display: "flex", flexDirection: "column", marginRight: "10vw"}}>
        <label for="items">Item to sell</label>
        {/* <select name="items" id="items">
          <option value="test">test</option>
        </select> */}
        <div>
        {Object.entries(prices.arak).map((item, i) => {
          return (
            <Fragment key={i}>
              <p>{item}</p>
            </Fragment>
          )
        })}
        </div>
        <button type="submit">Search</button>
      </div>

      <div>
        <p>Hej</p>
      </div>
    </div>
  )
}

export default App;
